import React from "react";
import MenuButton from "../MenuButton/MenuButton";

const MenuChoise = ({ logo, onChoice }) => {
  return (
    <>
      <div className="choice-container">
        <a href="/">
          <img src={logo} alt="React TicTacToe" />
        </a>
        <MenuButton
          onChoice={onChoice}
          type="primary"
          choice="new"
          label="Start New"
        />
        <MenuButton
          onChoice={onChoice}
          type="secondary"
          choice="join"
          label="Join Game"
        />
      </div>
    </>
  );
};

export default MenuChoise;
